import { motion } from 'framer-motion'

const NavLinks = (props) => {
    return (
        <ul className="menu">
            <motion.li onClick={() => props.isMobile && props.closeMobileMenu()}><a href="" className="nav-link">Home</a></motion.li>
            <motion.li onClick={() => props.isMobile && props.closeMobileMenu()}><a href="" className="nav-link">About</a></motion.li>
            <motion.li onClick={() => props.isMobile && props.closeMobileMenu()}><a href="" className="nav-link">Contact</a></motion.li>
            <motion.li onClick={() => props.isMobile && props.closeMobileMenu()}><a href="" className="nav-link">CV</a></motion.li>
            <motion.li onClick={() => props.isMobile && props.closeMobileMenu()}><a href="" className="nav-link">My Story</a></motion.li>
        </ul>
    );
}

export default NavLinks;
